export const Layout = ({ location, title, children }) => {
  const [menuOpen, setMenuOpen] = useState(false);
  const rootPath = `${__PATH_PREFIX__}/`;
  let header;
  if (location.pathname === rootPath) {
    header = (
      <LandingHeaderWrapper>
        <h1
          style={{
            ...scale(1.5),
            marginBottom: rhythm(1.5),
            marginTop: 0,
          }}
        >
          {title}
        </h1>
        <Hamburger
          size={25}
          duration={0.25}
          onToggle={toggled =>
            toggled ? setMenuOpen(true) : setMenuOpen(false)
          }
        />
        {menuOpen ? (
          <Menu>
            <Link
              style={{
                boxShadow: `none`,
                textDecoration: `none`,
                color: `inherit`,
              }}
              to={`/polar-pairs`}
            >
              Polar Pairs!
            </Link>
          </Menu>
        ) : null}
      </LandingHeaderWrapper>
    );
  } else {
    header = (
      <h3
        style={{
          marginTop: 0,
        }}
      >
        <Link
          style={{
            boxShadow: `none`,
            textDecoration: `none`,
            color: `inherit`,
          }}
          to={`/`}
        >
          {title}
        </Link>
      </h3>
    );
  }
  return (
    <Fragment>
      <Global />
      {location.pathname === rootPath ? (
        <LandingMainDiv>
          <header>{header}</header>
          <main>{children}</main>
          <Footer>
            <span>
              © {new Date().getFullYear()}, Built with
              {` `}
              <a href="https://www.gatsbyjs.org">Gatsby</a>
            </span>
          </Footer>
        </LandingMainDiv>
      ) : (
        <OtherMainDiv>
          <header>{header}</header>
          <main>{children}</main>
          <Footer>
            <span>
              © {new Date().getFullYear()}, Built with
              {` `}
              <a href="https://www.gatsbyjs.org">Gatsby</a>
            </span>
          </Footer>
        </OtherMainDiv>
      )}
    </Fragment>
  );
};

